import React, { useState } from 'react';
import './App.css';
import axios from 'axios';

function App() {
  const [inputText, setInputText] = useState('');
  async function aBtnClick() {
    const data = await axios.get(encodeURI('localhost:8080' + '/hello'));
    console.log('a', data);
  }
  async function bBtnClick() {
    const data = await axios.post('localhost:8080' + '/bye');
    console.log('b', data);
  }
  async function cBtnClick() {
    const data = await axios.post('localhost:8080' + '/hi');
    console.log('c', data);
  }
  async function dBtnClick() {
    const body = {
      text: inputText,
    };
    const data = await axios.post('localhost:8080' + '/text', body);
    console.log('d', data);
  }

  const handleChange = (e) => {
    setInputText(e.target.value);
  };
  return (
    <div>
      <button
        style={{ margin: '20px', padding: '20px', fontSize: '30px' }}
        onClick={aBtnClick}
      >
        A
      </button>
      <button
        style={{ margin: '20px', padding: '20px', fontSize: '30px' }}
        onClick={bBtnClick}
      >
        B
      </button>
      <button
        style={{ margin: '20px', padding: '20px', fontSize: '30px' }}
        onClick={cBtnClick}
      >
        C
      </button>
      <input
        style={{ margin: '20px', padding: '20px' }}
        value={inputText}
        onChange={(e) => handleChange(e)}
      ></input>
      <button
        style={{ margin: '20px', padding: '20px', fontSize: '30px' }}
        onClick={dBtnClick}
      >
        D
      </button>
      <div className="textBox"> </div>
    </div>
  );
}

export default App;
